import React, { useEffect, useState } from "react";
import { RouteComponentProps, withRouter } from "react-router";

const axios = require("axios");

type BookDetailParams = {
  id: string; // parameters will always be a string (even if they are numerical)
};
type BookDetailProps = RouteComponentProps<BookDetailParams>;

const Profile: React.FC<{ match: any }> = ({ match }) => {
  useEffect(() => {
    fetchItem();
  }, []);
  //   console.log(history);

  const [item, setItem] = useState({});

  const fetchItem = async () => {
    const fetchItem = await fetch(
      `https://jsonplaceholder.typicode.com/users/1`
    );
    const item = await fetchItem.json();
    setItem(item);
    // console.log(item);
    // const result = await axios("https://jsonplaceholder.typicode.com/users/1");
    // setdataProfile(result);
    // console.log(result.data);
  };

  return (
    <div>
      <div>Book ID: {match.params.id}</div>

      <div>DDDd</div>
      {/* <p>{item}</p> */}
    </div>
  );
};

export default withRouter(Profile);
